import React from "react";

export default function ConfirmDialog({
  title,
  children,
  confirm,
  cancel,
  open,
}) {
  return (
    <div>
      <dialog open={open}>
        <div>{title}</div>
        <div> {children}</div>

        <button type="button" onClick={confirm}>
          Confirm
        </button>

        <button type="button" onClick={cancel}>
          Cancel
        </button>
      </dialog>
    </div>
  );
}
